//公钥从证书中获取
function RSA_encrypt(plainText,publicKey){
    let pk=publicKey;
    let encrypt=new JSEncrypt();
    encrypt.setPublicKey(pk);
    let cipher=encrypt.encrypt(plainText);
    return cipher;
}